// roles.js
import React, { useEffect, useState } from 'react';
import transactionService from '../../services/transactionService';
import { useUser } from '../../context/userProvider';

import { Link, useNavigate } from 'react-router-dom';
import roleService from '../../services/roleService';

const RoleManager = () => {
    const navigate = useNavigate();

    const [page, setPage] = useState(1);
    const { user } = useUser();
    const [roles, setRoles] = useState();
    useEffect(() => {
        const fetchData = async () => {
            try {
                const data = await roleService.getAllByPage({ page: page, size: 5 });
                console.log(data);
                setRoles(data);
            } catch (error) {
                console.error('Error fetching products:', error);
            }
        };

        fetchData();
    }, [page]);


    const handleClick = (role) => {
        navigate('/dashboard/role-details', { state: { role } });
    }
    return (
        <div class="container">
            <div className='bg-gray-500'>
                {/* header */}
                <div className='flex justify-between mb-4'>
                    <input type="text" className='rouded rounded-md p-1' placeholder='Search' />
                    <button className='bg-orange-500 rounded rounded-md p-1 text-white'> Add product</button>
                    <button className='bg-white flex items-center p-1 rounded rounded-md'>
                        <svg xmlns="http://www.w3.org/2000/svg" aria-hidden="true" class="h-4 w-4 mr-1.5 -ml-1 text-gray-400" viewBox="0 0 20 20" fill="currentColor">
                            <path fill-rule="evenodd" d="M3 3a1 1 0 011-1h12a1 1 0 011 1v3a1 1 0 01-.293.707L12 11.414V15a1 1 0 01-.293.707l-2 2A1 1 0 018 17v-5.586L3.293 6.707A1 1 0 013 6V3z" clip-rule="evenodd"></path>
                        </svg> fillter options
                    </button>
                </div>
                {/* body */}
                <div className='overflow-x-auto'>
                    <table className='w-full '>
                        <thead className='text-xs text-gray-700 uppercase bg-gray-50 dark:bg-gray-700 dark:text-gray-400'>
                            <tr>
                                <th>Name</th>
                                <th>Type</th>
                                <th>Category</th>
                                <th>Quantity</th>
                                <th>Daily Sales</th>
                                <th>Monthly Sales</th>
                                <th>Rating</th>
                                <th>Total Sales</th>
                                <th>Total Revenue</th>
                                <th>Updated Date</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>Product </td>
                                <td>Type</td>
                                <td>Category</td>
                                <td>popup</td>
                                <td>1000</td>
                                <td>10000</td>
                                <td>5</td>
                                <td>5000</td>
                                <td>50000</td>
                                <td>2023-11-30</td>
                                <td className='flex '>
                                    <button className='bg-orange-500 p-2 rounded rounded-md flex justify-center'>
                                        <svg xmlns="http://www.w3.org/2000/svg" class="h-4 w-4 mr-2 -ml-0.5" viewBox="0 0 20 20" fill="currentColor" aria-hidden="true">
                                            <path d="M17.414 2.586a2 2 0 00-2.828 0L7 10.172V13h2.828l7.586-7.586a2 2 0 000-2.828z"></path>
                                            <path fill-rule="evenodd" d="M2 6a2 2 0 012-2h4a1 1 0 010 2H4v10h10v-4a1 1 0 112 0v4a2 2 0 01-2 2H4a2 2 0 01-2-2V6z" clip-rule="evenodd"></path>
                                        </svg>
                                        Edit</button>
                                    <button className='bg-gray-800 text-white p-2 rounded rounded-md'>Delete</button>
                                </td>
                            </tr>

                        </tbody>
                    </table>
                </div>
            </div>
        </div>

    );
};

export default RoleManager;
